DROP TABLE IF EXISTS tbl_ZipInState;
DROP TABLE IF EXISTS tbl_ZipInCounty;
DROP TABLE IF EXISTS tbl_State;
DROP TABLE IF EXISTS tbl_Place;
DROP TABLE IF EXISTS tbl_AmericanCommunitySurveyZipCode;
DROP TABLE IF EXISTS tbl_Zip;
DROP TABLE IF EXISTS tbl_County;


CREATE TABLE tbl_State (
    FIPSStateCode INT
    ,USPSStateCode VARCHAR(2)
    ,StateName VARCHAR(100)
    ,PRIMARY KEY(FIPSStateCode)
);

CREATE TABLE tbl_Zip (
    ZipCode VARCHAR(10)
    ,PRIMARY KEY(ZipCode)
);

CREATE TABLE tbl_County (
    FIPSCountyCode VARCHAR(5)
    ,FIPSCountyName VARCHAR(100)
    ,PRIMARY KEY(FIPSCountyCode)
);

CREATE TABLE tbl_ZipInState (
    ID INT AUTO_INCREMENT
    ,FIPSStateCode INT
    ,ZipCode VARCHAR(10)
    ,PRIMARY KEY(ID)
    ,FOREIGN KEY(FIPSStateCode) REFERENCES tbl_State(FIPSStateCode)
    ,FOREIGN KEY(ZipCode) REFERENCES tbl_Zip(ZipCode)
);

CREATE TABLE tbl_ZipInCounty (
    ID INT AUTO_INCREMENT
    ,ZipCode VARCHAR(10)
    ,FIPSCountyCode VARCHAR(5)
    ,PRIMARY KEY(ID)
    ,FOREIGN KEY(ZipCode) REFERENCES tbl_Zip(ZipCode)
    ,FOREIGN KEY(FIPSCountyCode) REFERENCES tbl_County(FIPSCountyCode)
);

CREATE TABLE tbl_Place (
    PlaceId INT AUTO_INCREMENT
    ,ZipCode VARCHAR(10)
    ,Place VARCHAR(100)
    ,PRIMARY KEY(PlaceId)
    ,FOREIGN KEY(ZipCode) REFERENCES tbl_Zip(ZipCode)
);

