DROP PROCEDURE IF EXISTS sp_AmericanCommunitySurveyZipCodeGet;
DELIMITER //
CREATE PROCEDURE sp_AmericanCommunitySurveyZipCodeGet (_SurveyYear INT)
BEGIN

    SELECT 
        acs.ZipCode AS Zip
        ,geo_id AS GeographyID
        ,GROUP_CONCAT(DISTINCT s.StateName SEPARATOR ', ') AS State
        ,GROUP_CONCAT(DISTINCT c.FIPSCountyName SEPARATOR ', ') AS Country
        ,GROUP_CONCAT(DISTINCT p.Place SEPARATOR ', ') AS City
        ,DP03_0062E AS MedianHouseholdIncome
        ,DP03_0062M AS MedianHouseholdIncomeMarginOfError
        ,DP03_0063E AS MeanHouseholdIncome
        ,DP03_0063M AS MeanHouseholdIncomeMarginOfError
        ,DP03_0088E AS PerCapitaIncome
        ,DP03_0088M AS PerCapitaIncomeMarginOfError
        ,DP03_0051E AS TotalHouseholds
        ,DP03_0051M AS TotalHouseholdsMarginOfError
        ,DP03_0052E AS TotalHouseholdsLessThan10000
        ,DP03_0052M AS TotalHouseholdsLessThan10000MarginOfError
        ,DP03_0053E AS TotalHouseholds10000To14999
        ,DP03_0053M AS TotalHouseholds10000To14999MarginOfError
        ,DP03_0054E AS TotalHouseholds15000To24999
        ,DP03_0054M AS TotalHouseholds15000To24999MarginOfError
        ,DP03_0055E AS TotalHouseholds25000To34999
        ,DP03_0055M AS TotalHouseholds25000To34999MarginOfError
        ,DP03_0056E AS TotalHouseholds35000To49999
        ,DP03_0056M AS TotalHouseholds35000To49999MarginOfError
        ,DP03_0057E AS TotalHouseholds50000To74999
        ,DP03_0057M AS TotalHouseholds50000To74999MarginOfError
        ,DP03_0058E AS TotalHouseholds75000To99999
        ,DP03_0058M AS TotalHouseholds75000To99999MarginOfError
        ,DP03_0059E AS TotalHouseholds100000To149999
        ,DP03_0059M AS TotalHouseholds100000To149999MarginOfError
        ,DP03_0060E AS TotalHouseholds150000To199999
        ,DP03_0060M AS TotalHouseholds150000To199999MarginOfError
        ,DP03_0061E AS TotalHouseholds200000OrMore
        ,DP03_0061M AS TotalHouseholds200000OrMoreMarginOfError
    FROM tbl_AmericanCommunitySurveyZipCode acs
        LEFT JOIN tbl_Zip z ON acs.ZipCode = z.ZipCode
        LEFT JOIN tbl_ZipInState zs ON z.ZipCode = zs.ZipCode
        LEFT JOIN tbl_State s ON zs.FIPSStateCode = s.FIPSStateCode
        LEFT JOIN tbl_ZipInCounty cs ON z.ZipCode = cs.ZipCode
        LEFT JOIN tbl_County c ON cs.FIPSCountyCode = c.FIPSCountyCode
        LEFT JOIN tbl_Place p ON z.ZipCode = p.ZipCode
    WHERE
        acs.SurveyYear = _SurveyYear
    GROUP BY
        acs.ZipCode
        ,geo_id
        ,DP03_0062E
        ,DP03_0062M
        ,DP03_0063E
        ,DP03_0063M
        ,DP03_0088E
        ,DP03_0088M
        ,DP03_0051E
        ,DP03_0051M
        ,DP03_0052E
        ,DP03_0052M
        ,DP03_0053E
        ,DP03_0053M
        ,DP03_0054E
        ,DP03_0054M
        ,DP03_0055E
        ,DP03_0055M
        ,DP03_0056E
        ,DP03_0056M
        ,DP03_0057E
        ,DP03_0057M
        ,DP03_0058E
        ,DP03_0058M
        ,DP03_0059E
        ,DP03_0059M
        ,DP03_0060E
        ,DP03_0060M
        ,DP03_0061E
        ,DP03_0061M
    ORDER BY acs.ZipCode;
    
END //
DELIMITER ;


